RACE_INFO_GNOME = "        A pesar de su baja estatura, los gnomos de Khaz Modan usaron su prodigioso intelecto para asegurarse un lugar en la Historia. Sin ninguna duda, su reino subterr√°neo, Gnomeregan, era una maravilla de la tecnolog√≠a a vapor. Pero as√≠ y todo, perdieron la ciudad durante una invasi√≥n masiva de troggs. Ahora, los creadores de esta maravilla vagan por las tierras de los enanos, ayud√°ndoles lo mejor que pueden.";
