RACE_INFO_GOBLIN = "Los goblins, que originalmente fueron los esclavos de los trols de la selva en la Isla de Kezan, se vieron forzados a trabajar en las minas de kaja'mita de Minahonda, en las entra√±as del Monte Kajaro. Lo que nadie sab√≠a en aquella √©poca era que el mineral ten√≠a propiedades m√°gicas que aumentaban r√°pidamente el ingenio y la inteligencia de los goblins. En secreto, crearon poderosos artefactos de ingenier√≠a y alquimia y derrocaron a los opresores trols, conquistando as√≠ la isla que ahora consideran su hogar. R√°pidamente destacaron por su maestr√≠a en el mercantilismo y, con sus conglomerados de compraventa globales, ahora dominan todo el comercio a lo largo y ancho de Azeroth.";
