RACE_INFO_HUMAN = "        Los humanos son una raza joven y, por lo tanto, muy vers√°til. Dominan las artes del combate, la artesan√≠a y la magia con una eficacia sorprendente. Su valor y optimismo los han llevado a levantar algunos de los reinos m√°s espl√©ndidos del mundo. En esta turbulenta era, tras generaciones de conflictos, los humanos quieren recuperar la gloria que los distingui√≥ otrora y forjarse un nuevo y brillante futuro.";
