RACE_INFO_NIGHTELF = "        Hace diez mil a√±os, los elfos de la noche fundaron un vasto imperio, pero el uso imprudente de la magia primaria los llev√≥ a la ruina. Consternados, se retiraron a los bosques donde se aislaron hasta el regreso de su antiguo enemigo: la Legi√≥n Ardiente. Entonces no tuvieron m√°s opci√≥n que abandonar su reclusi√≥n y luchar por su lugar en el nuevo mundo.";
