RACE_INFO_ORC = "        La raza de los orcos es originaria del planeta Draenor. Este pueblo pac√≠fico, de creencias cham√°nicas, fue esclavizado por la Legi√≥n Ardiente y forzado a participar en la guerra contra los humanos de Azeroth. Aunque tuvieron que pasar muchos a√±os, al final escaparon de la corrupci√≥n de los demonios y recuperaron su libertad. A d√≠a de hoy, luchan por su honor en un mundo que los odia y desprecia.";
