RACE_INFO_SCOURGE = "        Fuera del alcance del rey Ex√°nime, los Renegados buscan la manera de derrocarlo. El alma en pena Sylvanas lidera su sed de venganza contra la Plaga. Los humanos ahora tambi√©n son el enemigo, implacables en su intento de purgar de no-muertos el mundo. A los Renegados les importan poco incluso sus aliados; para ellos, la Horda no es m√°s que una herramienta para promover sus oscuros planes.";
