RACE_INFO_TAUREN = "        Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Tierra Madre. Hace poco fueron atacados por mort√≠feros centauros y habr√≠an sido aniquilados si no hubiese sido por un encuentro fortuito con los orcos, que les ayudaron a derrotar a los intrusos. Para hacer honor a esta deuda de sangre, los tauren se unieron a la Horda, afianzando la amistad de ambas razas.";
RACE_INFO_TAUREN_FEMALE = "Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Madre Tierra. Muchas de las tribus n√≥madas tauren se han unido bajo un √∫nico estandarte y se han asentado en las f√©rtiles llanuras de Mulgore. De no haber sido por la intervenci√≥n oportuna de los orcos, los centauros merodeadores habr√≠an aniquilado a toda la raza. Los tauren hacen honor a esta deuda de sangre luchando junto a la Horda para proteger su tierra.";
RACE_INFO_TROLL = "        Los fieros trols de la tribu Lanza Negra habitaban las junglas del Valle de Tuercespina hasta que facciones guerreras los expulsaron de all√≠. Con el tiempo, los trols entablaron amistad con la Horda de los orcos y Thrall, el joven jefe guerrero orco, los convenci√≥ para que viajasen con √©l a Kalimdor. A pesar de su inherente herencia oscura, los trols de la tribu Lanza Negra ocupan un lugar privilegiado en la Horda.";
